from google.cloud import automl# TODO(developer): Uncomment and set the following variablesproject_id = "qna-space"dataset_id = "TCN4819247975228243968"display_name = "qna_model"client = automl.AutoMlClient()# A resource that represents Google Cloud Platform location.project_location = f"projects/{project_id}/locations/us-central1"# Leave model unset to use the default base model provided by Googlemetadata = automl.TextClassificationModelMetadata()model = automl.Model(    display_name=display_name,    dataset_id=dataset_id,    text_classification_model_metadata=metadata,)# Create a model with the model metadata in the region.response = client.create_model(parent=project_location, model=model)print("Training operation name: {}".format(response.operation.name))print("Training started...")